import {
  SafeAreaView,
  StyleSheet,
  ScrollView,
  View,
  Text,
  Button,
  StatusBar,
} from 'react-native';

import {
  Header,
  LearnMoreLinks,
  Colors,
  DebugInstructions,
  ReloadInstructions,
} from 'react-native/Libraries/NewAppScreen';

const App: () => React$Node = () => {
  return (
    <>
      <StatusBar barStyle="light-content" />
      <SafeAreaView>
          <View style={{flex: 1, backgroundColor: Colors.blue}}>
          <View style={{flex: 2, backgroundColor: Colors.red}}> </View>
          <View style={{flex: 1}}>
            <Button
            style={styles.button}
              onPress={() => {
                alert('Login Stuff!');
              }}
              title="Login"/>
          </View>
          <View style={{flex: 1, backgroundColor: Colors.purple}}> </View>
